import React from 'react';
import '../../App.css';
import { Route, Routes } from 'react-router-dom';
import HeroSection from '../HeroSection';
import HowWorks from './HowWorks';

function Home() {
    return (
       
            <Routes>
                <Route exact path="/" element={<Home />} />
                <Route path="/howitworks" element={<HowWorks />} />
                <HeroSection />
            </Routes>

       
    );
}
export default Home;
